import React from 'react';
import Navbar from '../../components/navbar/Navbar';
import PriceTier from '../../components/priceTier/PriceTier';
import './pricing.css';

const pricingData = [
  {
    name: "The Career Builder",
    price: "59",
    description: "Full access to 2nd & 3rd degree contacts for any job. Bulk search contacts for all your applications in one click. A/B test your LinkedIn message templates.",
    search: "120",
    extension: true,
    second: true,
    bulk: true,
    templates: true,
    reply: true,
  },
  {
    name: "The Job Seeker",
    price: "29",
    description: "Discover the recruiter & hiring manager for any job. Find contacts immediately with Rocketstart's browser extension.",
    search: "30",
    extension: true,
    second: false,
    bulk: false,
    templates: true,
    reply: false,
  },
  {
    name: "The Networker",
    price: "0",
    description: "",
    search: "3",
    extension: false,
    second: false,
    bulk: false,
    templates: false,
    reply: false,
  },
]

const Pricing = () => {
  return (
    <div>
      <Navbar/>
      <div className='pricing'>
        <h1>
          Land Your
          <font className='color__change'> Dream Job </font>
        </h1>
        <div className='pricing__tiers'>
          {pricingData.map((item, index) => (
              <PriceTier
              name={item.name}
              price={item.price}
              description={item.description}
              search={item.search}
              extension={item.extension}
              second={item.second}
              bulk={item.bulk}
              templates={item.bulk}
              reply={item.reply}
              key={index}/>
              ))}
        </div>
      </div>
    </div>
  )
}

export default Pricing
